import React from "react";
import useGitProjects from "../../container/gitprojects/useGitProjects";

const ProjectGenerator: React.SFC = (props) => {
  const [data, isLoading] = useGitProjects();

  if (isLoading) {
    <p>Loading</p>;
  } else {
    data.map((item) => {
      <p>hi</p>;
    });
  }
};

export default ProjectGenerator;
